import React, { useState } from 'react';
import { useSelector , useDispatch} from 'react-redux';
import {
  updateProfilePicture,
  updateUsername,
  updatePreferences,
} from '../../Redux/user/userActions';

import {
  MDBBtn,
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,
  MDBModalTitle,
  MDBModalBody,
  MDBModalFooter,
  MDBCol, MDBContainer, MDBRow, MDBCard, MDBCardText, MDBCardBody, MDBCardImage, MDBTypography } from 'mdb-react-ui-kit';
import MinimizedCardComponent from '../Cards/MinimizedCard';

export default function ProfileModal(showProfileModal) {
  const [basicModal, setBasicModal] = useState(showProfileModal);
  const categories = useSelector(state => state.categories);
  const toggleShow = () => setBasicModal(!basicModal);

  const dispatch = useDispatch();

  const handleProfilePictureUpdate = (pictureUrl) => {
    dispatch(updateProfilePicture(pictureUrl));
  };

  const handleUsernameUpdate = (username) => {
    dispatch(updateUsername(username));
  };

  const handlePreferencesUpdate = (preferences) => {
    dispatch(updatePreferences(preferences));
  };
  return (
    <>
      <MDBModal show={basicModal} setShow={setBasicModal} tabIndex='-1'>
        <MDBModalDialog>
          <MDBModalContent>
            <MDBModalHeader>
              <MDBModalTitle>Edit profile</MDBModalTitle>
              <MDBBtn className='btn-close' color='none' onClick={toggleShow}></MDBBtn>
            </MDBModalHeader>
            <MDBModalBody>
                <div style={{ backgroundColor: '#9de2ff' }}>
                    <MDBCard>
                    <div className="text-white d-flex flex-row" style={{ backgroundColor: '#000', height: '200px' }}>
                        <div className="ms-4 mt-5 d-flex flex-column" style={{ width: '150px' }}>
                        <MDBCardImage src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-profiles/avatar-1.webp"
                            alt="Generic placeholder image" className="mt-4 mb-2 img-thumbnail" fluid style={{ width: '150px', zIndex: '1' }} />
                        <MDBBtn outline color="dark" style={{height: '36px', overflow: 'visible'}}>
                            Edit profile
                        </MDBBtn>
                        </div>
                        <div className="ms-3" style={{ marginTop: '130px' }}>
                        <ReactPencil name='name' value='John Doe'/>
                        <MDBCardText>New York</MDBCardText>
                        </div>
                    </div>
                    <div className="p-4 text-black" style={{ backgroundColor: '#f8f9fa' }}>
                        <div className="d-flex justify-content-end text-center py-1">
                        <div>
                            <MDBCardText className="mb-1 h5">253</MDBCardText>
                            <MDBCardText className="small text-muted mb-0">Photos</MDBCardText>
                        </div>
                        <div className="px-3">
                            <MDBCardText className="mb-1 h5">1026</MDBCardText>
                            <MDBCardText className="small text-muted mb-0">Followers</MDBCardText>
                        </div>
                        <div>
                            <MDBCardText className="mb-1 h5">478</MDBCardText>
                            <MDBCardText className="small text-muted mb-0">Following</MDBCardText>
                        </div>
                        </div>
                    </div>
                    <MDBCardBody className="text-black p-4">
                        <div className="mb-5">
                        <p className="lead fw-normal mb-1">Preferences</p>
                        <div className="p-4" style={{ backgroundColor: '#f8f9fa' }}>
                        {categories.map((cat) => {
                            return (
                                <MDBBtn outline rounded key={cat.id}  className={`m-1 ${[1,5].includes(cat.id) ? 'bg-primary' : ''}`} color='secondary'>
                                    {cat.name}
                                </MDBBtn>
                            )
                        })}
                        </div>
                        </div>
                        <div className="d-flex justify-content-between align-items-center mb-4">
                        <MDBCardText className="lead fw-normal mb-0">Recent Activities</MDBCardText>
                        </div>
                        <MDBRow>
                            <MDBCol className="mb-2">
                                <MinimizedCardComponent />
                            </MDBCol>
                        </MDBRow>
                    </MDBCardBody>
                    </MDBCard>
                </div>
            </MDBModalBody>

            <MDBModalFooter>
              <MDBBtn color='secondary' onClick={toggleShow}>
                Close
              </MDBBtn>
              <MDBBtn>Save preferences</MDBBtn>
            </MDBModalFooter>
          </MDBModalContent>
        </MDBModalDialog>
      </MDBModal>
    </>
  );
}
